import React from 'react'
import MoviesData from './movies'
import Movie from './movie'
function Movieslist() {
   
  return (
    <div>
        { MoviesData.map((akalista)=> <Movie akalista={akalista}/>)}
    </div>
  )
}

export default Movieslist;
